import Desktop from './Images/Desktop.svg';
import Trophy from './Images/Trophy.svg';

export const ExtraHeaderData = [{
    cardMedia: Desktop,
    cardTitle: "Easy to use"
}, {
    cardMedia: Trophy,
    cardTitle: "Easy to use"
}, {
    cardMedia: Desktop,
    cardTitle: "Easy to use"
}]
